import React, { Component } from 'react'
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
class Login extends Component {
    render () {
        return (
           
     
    <div class="landing-container">

        <div class="landing-logo"></div>
        <h2 padding-bottom>Login</h2>
            <form>
            <TextField id="filled-name" label="E-mail" margin="normal" variant="outlined" fullWidth color="secondary" />
            <TextField id="filled-name" label="Password" margin="normal" variant="outlined" fullWidth color="secondary" />
            <Button type="submit" variant="contained" color="primary" fullWidth>Register</Button>
            </form>
    </div>    
        )
    }
}

export default Login
